// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import MyPageCategory from './pages/myPage/myPage_category';
import MyPageHeader from './pages/myPage/myPage_header';
import MyPageMenu from './pages/myPage/myPage_menu';
import SizeGuidePage from './pages/sizeGuide/sizeGuidePage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/mypage/category" element={<MyPageCategory />} />
        <Route path="/mypage/header" element={<MyPageHeader />} />
        <Route path="/mypage/menu" element={<MyPageMenu />} />
        <Route path="/size-guide" element={<SizeGuidePage />} />
      </Routes>
    </Router>
  );
}

export default App;
